  true,\n\t\"url\": null,\n\t\"notes\": \"After each decennial census, the Census
  Bureau delineatesn          Public Use Microdata Areas (PUMAs) for the tabulation
  and dissemination of decennialn          census Public Use Microdata Sample (PUMS)
  data, American Community Survey (ACS) PUMS data,n          and ACS period estimates.
  Nesting within states, or equivalent entities, PUMAs cover then          entirety
  of the United States, Puerto Rico, Guam, and the U.S. Virgin Islands. PUMAn          delineations
  are subject to population, building block geography, geographic nesting, andn          contiguity
  criteria. Each PUMA is identified by a 5-character numeric census code that mayn
  \         contain leading zeros and a descriptive name.n          n          The
  TIGER/Line shapefiles and related database files (.dbf) are an extract of selected
  geographic and cartographicn          information from the U.S. Census Bureau's
  Master Address File / Topologically Integratedn          Geographic Encoding and
  Referencing (MAF/TIGER) Database (MTDB). The MTDB represents an          seamless
  national file with no overlaps or gaps between parts, however, each TIGER/Linen
  \         shapefile is designed to stand alone as an independent data set, or they
  can be combinedn          to cover the entire nation. \",\n\t\"license_title\":
